INSERT INTO `ta_segmento_b` VALUES (1,'No me siento triste','Me siento triste gran parte del tiempo','Estoy triste todo el tiempo','Estoy tan triste o soy tan infeliz que no puedo soportarlo'),(2,'No estoy desalentado respecto a mi futuro','Me siento más desalentado respecto de mi futuro  de lo que solía estarlo','No espero que las cosas funcionen para mi','Siento que no hay esperanza para mi futuro y que solo puede empeorar'),(3,'Obtengo tanto placer como siempre por las cosas de las que disfruto','No disfruto tanto de las cosas como solía hacerlo','Obtengo muy poco placer de las cosas que solía disfrutar','No puedo obtener ningún placer de las cosas de las que solía disfrutar'),(4,'Siento acerca de mi lo mismo que siempre','He perdido la confianza en mí mismo','Estoy decepcionado conmigo mismo','No me gusto a mí mismo'),(5,'No tengo ningún pensamiento de matarme','He tenido pensamientos de matarme, pero no lo haría','Querría matarme','Me mataría si tuviera la oportunidad de hacerlo'),(6,'No he perdido el interés en otras actividades o personas','Estoy menos interesado que antes en otras personas o cosas','He perdido casi todo el interés en otras personas o cosas','Me es difícil interesarme por algo'),(7,'No estoy más irritable que lo habitual','Estoy más irritable que lo habitual','Estoy mucho más irritable que lo habitual','Estoy irritable todo el tiempo');
/*!40000 ALTER TABLE `ta_segmento_b` ENABLE KEYS */;
