INSERT INTO `ta_segmento_d` VALUES (1,'¿Tienes un horario y un plan de trabajo para cada día y te ajustas a él?'),(2,'¿Terminas tus deberes y trabajos en el tiempo que te has propuesto?'),(3,'¿Le planteas tus dudas frecuentemente a tu profesor?'),(4,'¿Guardas junto a los apuntes los materiales de cada asignatura?'),(5,'¿Sigues activamente las clases, con las guías, tomando apuntes y notas de todas o casi todas las asignaturas?'),(6,'¿Pasas a limpio, haces resúmenes y esquemas de las asignaturas?'),(7,'Si el profesor hiciera un examen imprevisto ¿lo aprobarías?'),(8,'¿Tienes un lugar limpio y ordenado para estudiar que te permita concentrarte sin distracciones e interrupciones?'),(9,'¿Desayunas todos los días abundantemente antes de ir a las clases?'),(10,'¿Tienes como meta sacar notas superiores al aprobado?'),(11,'¿Te cuesta trabajo ponerte a estudiar?'),(12,'¿Encuentras aburrido el estudio y las clases?'),(13,'¿Dejas el estudio para las últimas horas de la noche?'),(14,'¿Dejas la mayor parte del repaso y estudio para los últimos días antes del examen?');
